import React, { Component } from 'react'
import './footer.css'
import Cards from '../Cards/Cards'
export default class Footer extends Component {
  constructor(props) {
    super(props);
    this.state = {
        Title1: 'Hello 10',
        value1: 'Welcome'
    }
}
  render() {
    return (
      <div className='footer_part'>
         <p>React App || Copyright 2024 || All Rights Reserved.</p>
         <Cards cardTitle1={this.state.Title1} cardValue1={this.state.value1} />
         <div className='bottom_footer'>
          <div className="column">
            <div className="card">
              <h2>{this.props.cardTitle} {this.props.cardTitle1}</h2>
              <p>{this.props.cardValue} {this.props.cardValue1}</p>
              <span>Demo Para</span>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
